This config defines a simple field calculation function. A calculate method only
has access to the record data and should return the value of the calculated field.
When provided in this way, the <a href='#!/api/Ext.data.field.Number-cfg-depends'>depends</a> config is automatically determined by
parsing the <a href='#!/api/Ext.data.field.Number-cfg-calculate'>calculate</a> function. For example:

     fields: [{
         name: 'firstName',
         type: 'string'
     },{
         name: 'lastName',
         type: 'string'
     },{
         name: 'fullName',
         calculate: function (data) {
             return data.firstName + ' ' + data.lastName;
         }
     }]

The above 'fullName' field is equivalent to:

     {
         name: 'fullName',
         convert: function (v, rec) {
             return rec.get('firstName') + ' ' + rec.get('lastName');
         },
         depends: ['firstName', 'lastName']
     }

The restrictions on form for a <a href='#!/api/Ext.data.field.Number-cfg-calculate'>calculate</a> method are that the accesses to field
values must match the following regular expression (case insensitive):

     data.([a-z_][a-z0-9_]*)
     // where 'data' is the param passed to the calculate method

The only advantage of a <a href='#!/api/Ext.data.field.Number-cfg-calculate'>calculate</a> method over a `convert` method is automatic
determination of <a href='#!/api/Ext.data.field.Number-cfg-depends'>depends</a>.

**Note:** The use of calculate and <a href='#!/api/Ext.data.field.Number-method-convert'>method-convert</a> are exclusive.  The
calculate method will override the convert method if both are configured.

(Optional) A path expression for use by the <a href='#!/api/Ext.data.reader.Reader'>Ext.data.reader.Reader</a> implementation that is creating the
<a href='#!/api/Ext.data.Model'>Ext.data.Model</a> to extract the Field value from the data object. If the path expression is the same
as the field name, the mapping may be omitted. A function may be passed to do complex data extraction. The examples
below are simple just to demonstrate the capability, typically, a function would not be used to extract such
simple data.

The form of the mapping expression depends on the Reader being used.

- <a href='#!/api/Ext.data.reader.Json'>Ext.data.reader.Json</a>

  The mapping is a string containing the javascript expression to reference the data from an element of the data
  item's <a href='#!/api/Ext.data.reader.Json-cfg-rootProperty'>Ext.data.reader.Json#cfg-rootProperty</a> Array. Defaults to the field name. If a function is passed,
  a single argument is received which contains the raw json object:

      // Server returns [{"name": "Foo", "age": 1}, {"name": "Bar", "age": 2}]
      mapping: function(data) {
          return data.name;
      }

- <a href='#!/api/Ext.data.reader.Xml'>Ext.data.reader.Xml</a>

  The mapping is an <a href='#!/api/Ext.dom.Query'>Ext.DomQuery</a> path to the data item relative to the DOM element that represents the
  <a href='#!/api/Ext.data.reader.Xml-cfg-record'>Ext.data.reader.Xml#record</a>. Defaults to the field name. If a function is passed, a single argument
  is received which contains the record node:

      // Server returns <Root><Person><Name>Foo</Name><Age>1</Age></Person><Person><Name>Bar</Name><Age>2</Age></Person></Root>
      mapping: function(data) {
          return data.firstChild.textContent;
      }

- <a href='#!/api/Ext.data.reader.Array'>Ext.data.reader.Array</a>

  The mapping is a number indicating the Array index of the field's value. Defaults to the field specification's
  Array position. If a function is passed, a single argument is received which contains the child array.

      // Server returns [["Foo", 1], ["Bar", 2]]
      mapping: function(data) {
          return data[0];
      }

If a more complex value extraction strategy is required, then configure the Field with a <a href='#!/api/Ext.data.field.Number-cfg-convert'>cfg-convert</a>
function. This is passed the whole row object, and may interrogate it in whatever way is necessary in order to
return the desired data.

The <a href='#!/api/Ext.data.Model-property-entityName'>Ext.data.Model#entityName</a> of the entity referenced by this field.
In most databases, this relationship is represented by a "foreign key". That is, a
value for such a field matches the value of the <a href='#!/api/Ext.data.Model-cfg-idProperty'>Ext.data.Model#idProperty</a>
for an entity of this type.

     Ext.define('MyApp.models.Organization', {
         extend: 'Ext.data.Model',
         ...
     });

     Ext.define('MyApp.models.User', {
         extend: 'Ext.data.Model',

         fields: [
             { name: 'organizationId', reference: 'Organization' }
         ],
         ...
     });

If a <a href='#!/api/Ext.data.field.Number-cfg-reference'>reference</a> is not nullable, set the <a href='#!/api/Ext.data.field.Field-cfg-allowBlank'>Ext.data.field.Field#allowBlank</a> property
to false.

     Ext.define('MyApp.models.User', {
         extend: 'Ext.data.Model',

         fields: [
             { name: 'organizationId', reference: 'Organization', allowBlank: false }
         ],
         ...
     });

If the name of the generated <a href='#!/api/Ext.data.schema.Association'>Ext.data.schema.Association</a> or other aspects
need to be specified, the <a href='#!/api/Ext.data.field.Number-cfg-reference'>reference</a> can be an object. The following usage shows
what would be generated by default given the above examples using the string form.

     Ext.define('MyApp.models.User', {
         extend: 'Ext.data.Model',

         fields: [{
             name: 'organizationId',
             reference: {
                 type: 'Organization',
                 association: 'UsersByOrganization',
                 role: 'organization',
                 inverse: 'users'
             }
         }],
         ...
     });

Finally, a <a href='#!/api/Ext.data.field.Number-cfg-reference'>reference</a> can also describe ownership between the entities. By default,
no ownership relationship is assumed. If, however, the User entities are owned by
their Organization, we could say this:

     Ext.define('MyApp.models.User', {
         extend: 'Ext.data.Model',

         fields: [{
             name: 'organizationId',
             reference: {
                 parent: 'Organization' // Organization is the parent of User
             }
         }],
         ...
     });

A function which converts a Field's value to a comparable value in order to ensure
correct sort ordering.

Predefined functions are provided in <a href='#!/api/Ext.data.SortTypes'>Ext.data.SortTypes</a>. A custom sort example:

    // current sort     after sort we want
    // +-+------+          +-+------+
    // |1|First |          |1|First |
    // |2|Last  |          |3|Second|
    // |3|Second|          |2|Last  |
    // +-+------+          +-+------+

    sortType: function(value) {
       switch (value.toLowerCase()) // native toLowerCase():
       {
          case 'first': return 1;
          case 'second': return 2;
          default: return 3;
       }
    }

May also be set to a String value, corresponding to one of the named sort types in
<a href='#!/api/Ext.data.SortTypes'>Ext.data.SortTypes</a>.

A function which converts the value provided by the Reader into the value that will
be stored in the record. This method can be overridden by a derived class or set as
a <a href='#!/api/Ext.data.field.Number-cfg-convert'>cfg-convert</a> config.

If configured as <a href='#!/api/null'>null</a>, then no conversion will be applied to the raw data property
when this Field is read. This will increase performance. but you must ensure that
the data is of the correct type and does not *need* converting.

Example of convert functions:

    function fullName(v, record){
        return record.data.last + ', ' + record.data.first;
    }

    function location(v, record){
        return !record.data.city ? '' : (record.data.city + ', ' + record.data.state);
    }

    Ext.define('Dude', {
        extend: 'Ext.data.Model',
        fields: [
            {name: 'fullname',  convert: fullName},
            {name: 'firstname', mapping: 'name.first'},
            {name: 'lastname',  mapping: 'name.last'},
            {name: 'city', defaultValue: 'unknown'},
            'state',
            {name: 'location',  convert: location}
        ]
    });

    // create the data store
    var store = Ext.create('Ext.data.Store', {
        model: 'Dude',
        proxy: {
            type: 'memory',
            reader: {
                type: 'json',
                rootProperty: 'daRoot',
                totalProperty: 'total'
            }
        }
    });

    var myData = [
        { key: 1,
          name: { first: 'Fat',    last:  'Albert' }
          // notice no city, state provided in data object
        },
        { key: 2,
          name: { first: 'Barney', last:  'Rubble' },
          city: 'Bedrock', state: 'Stoneridge'
        },
        { key: 3,
          name: { first: 'Cliff',  last:  'Claven' },
          city: 'Boston',  state: 'MA'
        }
    ];

The class (derived from <a href='#!/api/Ext.data.Model'>Ext.data.Model</a>) that defined this field.

     Ext.define('MyApp.models.Foo', {
         extend: 'Ext.data.Model',

         fields: [
             { name: 'bar' }
         ],
         ...
     });

     var barField = MyApp.models.Foo.getField('bar');

     alert(barField.definedBy === MyApp.models.Foo); // alerts 'true'

When a field is inherited, this value will reference the class that originally
defined the field.

     Ext.define('MyApp.models.Base', {
         extend: 'Ext.data.Model',

         fields: [
             { name: 'foo' }
         ],
         ...
     });

     Ext.define('MyApp.models.Derived', {
         extend: 'MyApp.models.Base',

         fields: [
             { name: 'bar' }
         ],
         ...
     });

     var fooField = MyApp.models.Derived.getField('foo');

     alert(fooField.definedBy === MyApp.models.Base); // alerts 'true'
